import {BrowserRouter, Routes, Route} from 'react-router-dom';
import HomePage from './components/HomePage/HomePage';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/welcome' element={<Home/>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
